def solve_problem(i, j):
    old_i, old_j = i, j
    if i > j: i, j = j, i
    max = prob(i)
    vals[i] = max
    while i < j:
        val = prob(i)
        vals[i] = val
        if val > max: max = val
        i += 1
    print(f'{old_i} {old_j} {max}')

if __name__ == '__main__':
    initime = time.time()
    problem_input = []
    line = input()
    while line:
        if line: problem_input.append(line.strip().split())
        try: line = input()
        except: line = ''
    for problem in problem_input:
        solve_problem(int(problem[0]), int(problem[1]))
    print(f'\nTotal time:{time.time() - initime}')
